import React, { useEffect, useState } from "react";
import axios from "axios";

const Mid = () => {
  const [data, setData] = useState([]);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      const options = {
        method: "GET",
        url: "https://airbnb45.p.rapidapi.com/api/v1/getCurrency",
        headers: {
          "X-RapidAPI-Key":
            "c0ae563f37mshd4b90cc967d0f2bp1071f8jsnae849873a031",
          "X-RapidAPI-Host": "airbnb45.p.rapidapi.com",
        },
      };

      try {
        const response = await axios.request(options);
        setData(response.data); // Update data state with fetched data
      } catch (error) {
        setError(error); // Set error state if request fails
      } finally {
